import React from 'react';
import './App.css';
import Header from './Header';
import AddContact from './AddContact';
import ContactList from './ContactList'
import contacts from './data';

function App() {



  return (
    <div className='ui container'>
    <Header />
    <AddContact />
    <ContactList contacts={contacts} />
    </div>
  );
}

export default App;
